import Jordan1 from './../img/Jordan.jpg';
import Yeezy from './../img/yeezy.jpg';

export const data = [
    {
        "id": 1,
        "name": "AirForce1",
        "color": "white",
        "img": Airforce1,
        "price": 100,
        "brand": 'Nike',
    },
    {
        "id": 2,
        "name": "Yung96",
        "color": "black",
        "img": Yung,
        "price": 150,
        "brand": 'Adidas',
    },
    {
        "id": 3,
        "name": "Jordan1",
        "color": "red", 
        "img": Jordan1,
        "price": 200,
        "brand": 'Nike',
    },
    {
        "id": 4,
        "name": "yeezy",
        "color": "Blue", 
        "img": Yeezy,
        "price": 250,
        "brand": 'Adidas',
    },
]
